                     +  '               </gml:' + geom_type + '>\n'
                     +  '           </' + namespace + ':the_geom>\n'
                     +  '       </' + self.options.typeName + '>\n'
                     +  '   </wfs:Insert>\n'
                     +  '</wfs:Transaction>\n';

